import React from 'react';
import PropTypes from 'prop-types';

function MoodCalendar({ patientId, data, viewMode = 'patient', isExpanded = false }) {
  const moodData = data?.moodData || [];

  if (!moodData.length) {
    return (
      <div className="chart-placeholder">
        <p>No mood data available for {patientId}</p>
      </div>
    );
  }

  return (
    <div className="mood-calendar">
      <div className="chart-content" style={{ height: isExpanded ? 450 : 300 }}>
        <p>Mood Calendar - {moodData.length} mood entries</p>
        <p>Chart implementation coming soon...</p>
      </div>
    </div>
  );
}

MoodCalendar.propTypes = {
  patientId: PropTypes.string.isRequired,
  data: PropTypes.object.isRequired,
  viewMode: PropTypes.oneOf(['patient', 'physician']),
  isExpanded: PropTypes.bool
};

export default MoodCalendar;
